import React from 'react';
import ReactMarkdown from 'react-markdown';

function KaggleContent({ content }) {
  return (
    <div className="kaggle-content">
      <ReactMarkdown>{content}</ReactMarkdown>
    </div>
  );
}

export default KaggleContent;
